class MainTable extends React.Component {


    constructor(props) {
        super(props)
        this.state = {
            json: [],
            headersText: ["Region Name",
                          "Region alpha code",
                          "Value",
                          "Reference date"]
        }
    }

    _handleChangeEvent(val) {
        return val;
    }

    renderHeaders() {
        /*
        let headersText = ["Region Name",
                           "Region alpha code",
                           "Value",
                           "Reference date"];
        */
        let headers = [];

        this.state.headersText.map((header) => {
            headers.push(<th onClick={this.changeTitle}>
                         <input type="text" readonly onChange={()=>{this._handleChangeEvent(header);}} 
                            defaultValue={header}/> 
                         <a ><i class="fa">&#xf040;</i></a> 
                         <a href="index.html"><i class="fa">&#xf014;</i></a> 
                         </th>);
            return headers; 
        }); 

        return headers; 

    }

    changeTitle = () => {

        this.setState({ 
            headersText: 
            ["Regions",
            "Interesting",
            "Neu",
            "Gut"] 
        });
     };

    componentDidMount() {
        this.setState((prevState) => {
            return {
                json: getData()
            }
        })
    }

    render() {
        return (
            <div>
                <table>
                    <thead>
                        <tr>
                            {this.renderHeaders()}
                        </tr>
                    </thead>
                    <tbody>
                        {this.state.json.map((data, i) => {
                        return (
                            <tr key={i}>
                            <td>{data.region_name}</td>
                            <td>{data.region_alpha_code}</td>
                            <td>{data.value}</td>
                            <td>{data.ref_date}</td>
                            </tr>
                        )
                        })}
                    </tbody>
                </table>
            </div>
        )
    }
}

export default MainTable;






